import React, { useState } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import FormDesigner from './FormDesigner';
import DesignedForm from './DesignedForm'; // Assuming you have a DesignedFormPage component
import './App.css';

function App() {
  const [fields, setFields] = useState([]);

  return (
    <Router>
      <div className="App">
        <Route path="/" exact>
          <FormDesigner fields={fields} setFields={setFields} />
        </Route>
        <Route path="/designed-form">
          <DesignedForm fields={fields} />
        </Route>
      </div>
    </Router>
  );
}

export default App;
